export interface MessageCreated {
    type: "message_created";
    data: {
        /**
         * Identifier of the [Message](#schema_message)
         */
        id: string;
        /**
         * Creation date of the [Message](#schema_message) in ISO 8601 format
         */
        createdAt: string;
        /**
         * Payload is the content type of the message.
         */
        payload: {
            audioUrl: string;
            type: "audio";
            [k: string]: any;
        } | {
            title: string;
            subtitle?: string;
            imageUrl?: string;
            actions: {
                action: "postback" | "url" | "say";
                label: string;
                value: string;
                [k: string]: any;
            }[];
            type: "card";
            [k: string]: any;
        } | {
            items: {
                title: string;
                subtitle?: string;
                imageUrl?: string;
                actions: {
                    action: "postback" | "url" | "say";
                    label: string;
                    value: string;
                    [k: string]: any;
                }[];
                [k: string]: any;
            }[];
            type: "carousel";
            [k: string]: any;
        } | {
            text: string;
            options: {
                label: string;
                value: string;
                [k: string]: any;
            }[];
            type: "choice";
            [k: string]: any;
        } | {
            text: string;
            options: {
                label: string;
                value: string;
                [k: string]: any;
            }[];
            type: "dropdown";
            [k: string]: any;
        } | {
            fileUrl: string;
            title?: string;
            type: "file";
            [k: string]: any;
        } | {
            imageUrl: string;
            type: "image";
            [k: string]: any;
        } | {
            latitude: number;
            longitude: number;
            address?: string;
            title?: string;
            type: "location";
            [k: string]: any;
        } | {
            markdown: string;
            type: "markdown";
            [k: string]: any;
        } | {
            text: string;
            type: "text";
            [k: string]: any;
        } | {
            videoUrl: string;
            type: "video";
            [k: string]: any;
        };
        /**
         * ID of the [User](#schema_user)
         */
        userId: string;
        /**
         * ID of the [Conversation](#schema_conversation)
         */
        conversationId: string;
        /**
         * Whether the message was created by the bot or not
         */
        isBot: boolean;
    };
}
